import React from 'react';


export default function NavBar(props){

    if (props.view === true){
        return (

            <div id ="nav" class="card-header">
                <ul class="nav nav-pills card-header-pills">
                    <li class="nav-item">
                        <button id="btns-nav" class="btn btn-outline-secondary btn-lg" onClick={()=>placeholder()} >complete tasks</button>
                    </li>
                    <li class="nav-item">
                        <button id="btns-nav" class="btn btn-outline-dark" onClick={()=>props.onToggleView()} >incomplete tasks</button>
                    </li>
                </ul>
            </div>

        )}

    return (

            <div id ="nav" class="card-header">
                <ul class="nav nav-pills card-header-pills">
                    <li class="nav-item">
                    <button id="btns-nav" class="btn btn-outline-dark" onClick={()=>props.onToggleView()}>complete tasks</button>
                    </li>
                    <li class="nav-item">
                        <button id="btns-nav" class="btn btn-outline-dark" onClick={()=>placeholder()} >incomplete tasks</button>
                    </li>
                </ul>
            </div>

    )
}

function placeholder(){
    console.log("ask Benny and David how to solve this!")
}
